import React, { Component } from 'react';
import { Head4 } from '../styles/Head4';

export default class CreS extends Component {
  render() {
	return( 
		<div>
			<Head4 className="text-center text-capitalize">Hello CreM!</Head4>
		</div>
	)
   }
}
